        <div className="centro">
            <div className="Footer">
                <div className="text">
                    <p>Real Vagas & SENAI</p>
                    <p>Contato: (XX) XXXX-XXXX</p>
                    <p>senai@email.com</p>
                </div>

                <hr />

                <div className="images">
                    <img src="" alt=""/>
                    <img src="" alt=""/>
                </div>
            </div>
        </div>
    )
}

export default Footer;
